uploadtext:
Файлдар чүдүрерде бо форманы ажыглаңар.
Ооң мурнунда чүдүрттүнген файлдарны көөрде азы тыварда, [[Special:FileList|чүдүрттүнген файлдар даңзызынче]] шилчиңер. Чүдүрүглер база улай чүдүрүглер [[Special:Log/upload|чүдүрүглер дептеринде]] база бүрүткеттинип турар. Балаттынган файлдар дугайында бердингеннерни [[Special:Log/delete|балаашкын дептеринден]] тып ап болур.

Чүүлче файлды киирерде дараазында форматтарда шөлүлгелерни ажыглаңар:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файлдың долу янзызын ажыглаарда;
** <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> сөзүглелдиң солагай талазынга 200 пиксель хемчээлдиг адаанда тайылбырлыг чурумалды немээрде;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> ооң иштин көргүспейн, файлче дорт кирерде.

